    "The certificate for this learner has been re-validated and the system is re-running the grade for this learner.": "\u03a4\u03bf \u03c0\u03b9\u03c3\u03c4\u03bf\u03c0\u03bf\u03b9\u03b7\u03c4\u03b9\u03ba\u03cc \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03cc\u03bd \u03c4\u03bf \u03bc\u03b1\u03b8\u03b7\u03c4\u03ae \u03ad\u03c7\u03b5\u03b9 \u03be\u03b1\u03bd\u03ac \u03b9\u03c3\u03c7\u03cd \u03ba\u03b1\u03b9 \u03c4\u03bf \u03c3\u03cd\u03c3\u03c4\u03b7\u03bc\u03b1 \u03b5\u03c0\u03b1\u03bd\u03b1\u03ba\u03b1\u03b8\u03bf\u03c1\u03af\u03b6\u03b5\u03b9 \u03c4\u03bf \u03b2\u03b1\u03b8\u03bc\u03cc \u03c4\u03bf\u03c5.",
