    "This thread is closed.": "\u03a4\u03bf \u03bd\u03ae\u03bc\u03b1 \u03b1\u03c5\u03c4\u03cc \u03ad\u03c7\u03b5\u03b9 \u03ba\u03bb\u03b5\u03b9\u03b4\u03c9\u03b8\u03b5\u03af",
