    "Vote for this post,": "\u03a5\u03c0\u03b5\u03c1\u03c8\u03b7\u03c6\u03af\u03c3\u03c4\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03b1\u03bd\u03ac\u03c1\u03c4\u03b7\u03c3\u03b7",
